import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

// Images
import logo from "../assets/logo.jpg";
import bracelet1 from "../assets/bridal-bracelet1.jpg"; // Golden + Red Stone
import bracelet2 from "../assets/bridal-bracelet2.jpg"; // Pearl + White Stones
import bracelet3 from "../assets/bridal-bracelet3.jpg"; // Golden-Silver Kada

const BridalBracelets = () => {
  const navigate = useNavigate();
  const [search, setSearch] = useState("");

  const bracelets = [
    {
      name: "Golden Elegance Bracelet",
      img: bracelet1,
      desc: "Stunning golden bracelet featuring a red stone centerpiece, perfect for a royal and classy bridal look.",
      price: "₹22,000",
    },
    {
      name: "Pearl & White Stone Bracelet",
      img: bracelet2,
      desc: "Elegant bracelet with pearls and sparkling white stones, ideal for a graceful and sophisticated bridal appearance.",
      price: "₹20,500",
    },
    {
      name: "Golden-Silver Kada Bracelet",
      img: bracelet3,
      desc: "Striking golden and silverish kada-style bracelet, giving a traditional yet majestic touch for your special day.",
      price: "₹25,000",
    },
  ];

  const filtered = bracelets.filter((item) =>
    item.name.toLowerCase().includes(search.toLowerCase())
  );

  return (
    <div className="home-container">
      {/* Header */}
      <header className="navbar">
        <div className="logo">
          <img src={logo} alt="Elegant Jewelry Logo" className="logo-img" />
          <span className="brand-name">Elegant Jewelry</span>
        </div>
        <ul className="nav-links">
          <li><a href="/">Home</a></li>
          <li><a href="/about">About</a></li>
          <li><a href="/collections">Collections</a></li>
          <li><a href="/orders">Orders</a></li>
          <li><a href="/wishlist">Wishlist</a></li>
          <li><a href="/contact">Contact</a></li>
        </ul>
      </header>

      {/* Search Bar */}
      <div className="search-bar" style={{ textAlign: "center", margin: "40px 0 20px 0" }}>
        <input
          type="text"
          placeholder="Search Bracelets..."
          value={search}
          onChange={(e) => setSearch(e.target.value)}
          style={{
            padding: "10px 20px",
            borderRadius: "25px",
            border: "2px solid #d6336c",
            width: "260px",
            outline: "none",
            fontSize: "15px",
          }}
        />
        <button
          style={{
            marginLeft: "10px",
            padding: "10px 25px",
            borderRadius: "25px",
            border: "none",
            backgroundColor: "#d6336c",
            color: "white",
            fontWeight: "500",
            cursor: "pointer",
          }}
          onClick={() => alert(`Searching for: ${search}`)}
        >
          Search
        </button>
      </div>

      {/* Bracelets Section */}
      <section className="collections-section">
        <h2 className="collections-title">Bridal Bracelets</h2>
        <div className="collections-grid">
          {filtered.map((item, index) => (
            <div key={index} className="collection-card">
              <img src={item.img} alt={item.name} />
              <div className="card-panel">
                <h3 className="collection-name">{item.name}</h3>
                <p className="collection-desc">{item.desc}</p>
                <p className="collection-price" style={{ fontWeight: "bold", marginBottom: "10px" }}>
                  {item.price}
                </p>

                {/* Buttons Row */}
                <div className="button-row" style={{ display: "flex", gap: "10px", marginBottom: "10px" }}>
                  <button
                    className="buy-btn"
                    onClick={() => alert(`Buying: ${item.name}`)}
                    style={{ backgroundColor: "#d6336c", color: "#fff", padding: "8px 15px", borderRadius: "20px", border: "none", cursor: "pointer" }}
                  >
                    Buy Now
                  </button>
                  <button
                    className="addcart-btn"
                    onClick={() => alert(`Added to Cart: ${item.name}`)}
                    style={{ backgroundColor: "#d6336c", color: "#fff", padding: "8px 15px", borderRadius: "20px", border: "none", cursor: "pointer" }}
                  >
                    Add to Cart
                  </button>
                </div>

                <div className="wishlist-row">
                  <button
                    className="wishlist-btn"
                    onClick={() => alert(`Added to Wishlist: ${item.name}`)}
                    style={{ backgroundColor: "#d6336c", color: "#fff", padding: "8px 20px", borderRadius: "20px", border: "none", cursor: "pointer" }}
                  >
                    Wishlist
                  </button>
                </div>
              </div>
            </div>
          ))}
        </div>
      </section>

      {/* Footer */}
      <footer className="site-footer" style={{ backgroundColor: "#000", color: "#fff", padding: "20px 0", textAlign: "center", marginTop: "50px" }}>
        <p>© 2025 Elegant Jewelry. All Rights Reserved.</p>
      </footer>
    </div>
  );
};

export default BridalBracelets;
